import { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Component/Home';
import './App.css';


function App() {
  const [page, setPage] = useState("login")
  const changePage = (pageName) => {setPage(pageName)}

  const switchPage = () => {
    switch(page) {
      case "login":
        return <Login  changePage={changePage} />

    }
  } 



  return (
    <div className="App">
       {switchPage()}
     <Router>
      <Routes>
        <Route path='/' element={<Home />}/>
      </Routes>
     </Router>
    </div>
  );
}

export default App;
